import React from 'react'
import Markets from '../markets/markets.js';
import './banner.css'

function Grafits() {
  return <h2>About</h2>;
}

function Suport() {
  return <h2>Suport</h2>;
}




function Banner () {

      return(
        <Router>

          <div className="banner">
                <div className="banner-bottom">
                  <Link  to="/markets/">Markets</Link>
                </div>
                <div className="banner-bottom">
                  <Link to="/about">Grafits</Link>
                </div>
                <div className="banner-bottom">
                  <Link to="/suport">Suport</Link>
                </div>

                <Switch>
                  <Route path="/markets" component={Markets} />
                  <Route path="/about" component={Grafits} />
                  <Route path="/suport" component={Suport} />
                </Switch>
          </div>

      </Router>

    )

}
export default Banner;
